@VueComponent(mixins: const [BaseMixin], template: r'''
<m-top-app-bar
  v-on="$listeners"
  :theming="theming"
  :collapsed="collapsed"
  :short="short"
  :prominent="prominent"
  :dense="dense"
  :fixed="fixed"
  @onNavigation="$emit('onNavigation')"
>
  <slot v-if="$slots.default"></slot>
  <template v-if="$slots.navigation" slot="navigation">
    <slot name="navigation"></slot>
  </template>
  <template v-if="$slots.actions" slot="actions">
    <slot name="actions"></slot>
  </template>
</m-top-app-bar>''')
class MTopAppBar extends VueComponentBase with BaseMixin {
  MTopAppBar() { _initialize(); }
  @prop
  bool collapsed = false;
  @prop
  bool short = false;
  @prop
  bool prominent = false;
  @prop
  bool dense = false;
  @prop
  bool fixed = false;
}

@VueComponent(mixins: const [BaseMixin], template: r'''
<m-top-app-bar-fixed-adjust
  v-on="$listeners"
  :theming="theming"
  :dense="dense"
  :short="short"
  :prominent="prominent"
  :denseProminent="denseProminent"
>
  <slot v-if="$slots.default"></slot>
</m-top-app-bar-fixed-adjust>''')
class MTopAppBarFixedAdjust extends VueComponentBase with BaseMixin {
  MTopAppBarFixedAdjust() { _initialize(); }
  @prop
